import React from 'react'
import {Link,Outlet} from'react-router-dom';
import './NavbarStyles.css';
const UserDashboard = ()=> {
    return(
    <div>
        <h1>Welcome User</h1>
        <div>
            <ul className="cont">
                <li className="con"><Link to="/viewusercategories">View Products</Link></li>
                <li className="back"><Link to="/">Back</Link></li>
                <li className="back"><Link to="/">Logout</Link></li>
            </ul>
        
        </div>
        <Outlet/>
    </div>
    );
    
}
export default UserDashboard
